/*Table structure for table `roomprice` */

DROP TABLE IF EXISTS `roomprice`;

CREATE TABLE `roomprice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `priceMargin` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

/*Data for the table `roomprice` */

insert  into `roomprice`(`id`,`priceMargin`) values (1,'1500以下'),(2,'1500--2500元'),(3,'2500--3500元'),(4,'3500--4500元'),(5,'4500--6000元'),(6,'6000元以上');

/*Table structure for table `rooms` */

DROP TABLE IF EXISTS `rooms`;

CREATE TABLE `rooms` (
  `roomId` int(11) NOT NULL AUTO_INCREMENT COMMENT '房屋ID',
  `roomName` varchar(32) NOT NULL COMMENT '房屋名称',
  `roomArea` varchar(32) NOT NULL COMMENT '房屋面积',
  `roomNumber` varchar(32) DEFAULT NULL COMMENT '房间编号，合租存在',
  `roomNumbers` varchar(32) DEFAULT NULL COMMENT '房间数量，合租存在',
  `houseType` varchar(32) DEFAULT NULL COMMENT '户型名称',
  `floor` varchar(32) DEFAULT NULL COMMENT '楼层',
  `roomLocation` varchar(255) DEFAULT NULL COMMENT '位置',
  `elevator` varchar(32) DEFAULT NULL COMMENT '电梯有无',
  `completion` varchar(32) DEFAULT NULL COMMENT '建成日期',
  `heatingType` varchar(32) DEFAULT NULL COMMENT '供暖方式',
  `afforest` varchar(32) DEFAULT NULL COMMENT '绿化面积',
  `areaLocation` varchar(32) DEFAULT NULL COMMENT '所在区域',
  `subway` varchar(32) DEFAULT NULL COMMENT '地铁线',
  `tenementName` varchar(32) DEFAULT NULL COMMENT '租房类型名称',
  `roomPrice` int(11) DEFAULT NULL COMMENT '房间价格',
  `characterName` varchar(32) DEFAULT NULL COMMENT '特色户型名称',
  `orientationName` varchar(32) DEFAULT NULL COMMENT '房间朝向',
  `statusName` varchar(32) DEFAULT NULL COMMENT '房源状态名称',
  `specialOffer` varchar(32) DEFAULT NULL COMMENT '优惠活动',
  `roomTime` int(11) DEFAULT NULL COMMENT '房间租赁时长',
  `videoURL` varchar(255) DEFAULT NULL COMMENT '房间视频地址',
  `roomPic` varchar(255) DEFAULT NULL COMMENT '展示图片',
  `uid` int(11) DEFAULT NULL COMMENT '中介id',
  PRIMARY KEY (`roomId`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

