/*Table structure for table `tenant` */

DROP TABLE IF EXISTS `tenant`;

CREATE TABLE `tenant` (
  `tId` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `tNickname` varchar(32) DEFAULT NULL COMMENT '昵称',
  `tPhone` varchar(32) DEFAULT NULL COMMENT '手机号',
  `tEmail` varchar(32) DEFAULT NULL COMMENT '邮箱',
  `tPassword` varchar(32) DEFAULT '123456' COMMENT '密码',
  PRIMARY KEY (`tId`),
  UNIQUE KEY `tPhone` (`tPhone`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

